export type props = {
  children: React.ReactNode;
};

export const Base = ({ children }: props) => (<Fragment>
  {children}

  <style jsx global>{`
    body {
      margin: 0;
    }
    *:focus {
      outline: none;
    }
  `}</style>
</Fragment>);

